import CheckOff from "../../../assets/images/icon_checkbox_16px_off.svg";
import MoreIcon from '../../../assets/images/icon_more.svg';
import CheckOn from '../../../assets/images/icon_checkbox_16px_on.svg';
import React, {useState} from "react";
import AgreeText from "./agreeText";

const AgreeButton =() => {
    const [show, setShow] = useState(false);
    return (
        <div className='flex mx-4 mt-4 base_text items-center'>
            <button className='flex' onClick={(e : React.MouseEvent<HTMLElement>) => setShow(!show)}>
                민감정보 및 고유식별정보의 처리에 관한 사항
                <img src={MoreIcon} alt={'more'}/>
            </button>
            <button className='ml-auto flex items-center' ><img src={CheckOff} alt={'check'} className='mr-2'/>동의</button>
            {show && <AgreeText sel={show} setSel={setShow} />}
        </div>
    )
}
export default AgreeButton;
